import React from 'react';
import {Search, Grid, Header, Segment} from 'semantic-ui-react'
import './App.css';

function App() {
  return (
    <Grid>
        <Grid.Column width={6}>
          <Search
            fluid
          />
        </Grid.Column>
        <Grid.Column width={10}>
          <Segment>
            <Header>State</Header>
            <pre style={{ overflowX: 'auto' }}>
            </pre>
            <Header>Options</Header>
            <pre style={{ overflowX: 'auto' }}>
            </pre>
          </Segment>
        </Grid.Column>
      </Grid>
  );
}

export default App;
